import Head from 'next/head'
import Navbar from './Navbar';

const Layout = (props) => (
    <div>
        <Head>
            <title>BitzPrice</title>
        </Head>
        <Navbar/>
        <h1>Main Pages</h1>
        {props.children}
    </div>
);

export default Layout;
